function getOppositeColor(currentColor: string) {
  // Convert current color to RGB values
  var matches = currentColor.match(/\d+/g);
  if (matches === null) return
  var r = parseInt(matches[0]);
  var g = parseInt(matches[1]);
  var b = parseInt(matches[2]);

  // Calculate inverse of each RGB value
  var inverseR = 255 - r;
  var inverseG = 255 - g;
  var inverseB = 255 - b;

  // Convert inverse RGB values to hexadecimal color code
  var oppositeColor = "#" + ((1 << 24) | (inverseR << 16) | (inverseG << 8) | inverseB).toString(16).slice(1);

  return oppositeColor;
}

